For most of Slack Web API methods (except for OAuth methods, Incoming Webhooks and event replies) you need a Slack token to make a call. For simple bots you can have it in your config files, or you can obtain workspace tokens using Slack OAuth. In the example below, we’re using a hardcoded Slack token, but don’t do that for your production bots and apps. You should securely and properly store all of Slack tokens. use slack_morphism::*;
use slack_morphism::api::*;
use slack_morphism_models::*; // Slack Morphism Hyper/Tokio support
use slack_morphism_hyper::*; async fn example() -> Result<(), Box<dyn std::error::Error + Send + Sync>> { let hyper_connector = SlackClientHyperConnector::new(); let client = SlackClient::new(hyper_connector); // Create our Slack API token let token_value: SlackApiTokenValue = "xoxb-89.....".into(); let token: SlackApiToken = SlackApiToken::new(token_value); // Create a Slack session with this token let session = client.open_session(&token); // Make your first API call (which is `api.test` here) let test: SlackApiTestResponse = session .api_test(&SlackApiTestRequest::new().with_foo("Test".into())) .await?; // Send a simple text message let post_chat_req = SlackApiChatPostMessageRequest::new("#general".into(), SlackMessageContent::new().with_text("Hey there!".into()) ); let post_chat_resp = session.chat_post_message(&post_chat_req).await?; Ok(())
}

